drop table if exists usr_details;
create table usr_details (
	usr_name VARCHAR(500),
	animal VARCHAR(500),
	plant VARCHAR(500),
	file_desc VARCHAR(500),
	domain VARCHAR(500),
	md5 VARCHAR(500),
	univ VARCHAR(500),
	slogan VARCHAR(50),
	jobTitle VARCHAR(50),
	fullName VARCHAR(50),
	fakeCompany VARCHAR(50),
	company VARCHAR(500),
	sha VARCHAR(500),
	IBAN VARCHAR(50),
	digiSeq VARCHAR(50),
	drug_Name VARCHAR(500)
);
